import "./Main.css";

const Home = () => {
  return (
    <>
      <div className="container">
        <div className="subcontainer1">
          <h2>Toll Management Application</h2>
        </div>

        
      </div>
<br></br>
<div className="tablecontainer">
        <table>
          <tr>
            <th style={{"width":"70%"}}>VEHICLE TYPE</th>
            <th style={{"width":"70%"}}>VEHICLE NUMBER</th>
            <th>DATE/TIME</th>
            <th style={{"width":"70%"}}>TOOL NAME</th>
            <th style={{"width":"70%"}}>TARRIF</th>
          </tr>
        </table>
        </div>
    </>
  );
};

export default Home;
